2906300},"willBeRetried":false}},{"source":{"uri":"file:///C:/Users/enggn/eclipse-workspace/DSAlgo_Cucumber/src/test/resources/Features/03_dsSignin.feature","data":"Feature: to automate Signin page of DS_Algo\n\n  Background: background\n    Given The user is on the DS Algo Introduction Page\n\n  @Signin_page(link)\n  Scenario: DS Algo Introduction Page\n    When The user should click the Sign in link\n    Then The user should be redirected to Sign in page\n    And The user is able to see \"Register!\" link  below the text boxes\n\n  @Signin_page(allBlank)\n  Scenario Outline: DS Algo Introduction Page\n    When The user clicks login button after leaving the \"<username>\" textbox and \"<password>\" textbox blank\n    Then The error message \"Please fill out this field.\" appears below Username textbox\n\n    Examples: \n      | username | password |\n      |          |          |\n\n  @Signin_page(enteronlyusername)\n  Scenario Outline: DS Algo Introduction Page\n    When The user clicks login button after entering the \"<username>\" and leaves \"<password>\" textbox blank\n    Then The error message \"Please fill out this field.\" appears below Pwd textbox\n\n    Examples: \n      | username            | password |\n      | Trioteamchallengers |          |\n\n  @Signin_page(enteronlypwd)\n  Scenario Outline: DS Algo Introduction Page\n    When The user clicks login button after entering the \"<password>\" only.\n    Then The error message \"Please fill out this field.\" appears below Username textbox\n\n    Examples: \n      | password      |\n      | ds@qateam334h |\n\n  @Signin_page(invalidusernamePwd)\n  Scenario Outline: DS Algo Introduction Page\n    When The user clicks login button after entering invalid \"<username>\" and invalid \"<password>\"\n    Then The user should able to see an error message \"Invalid Username and Password\".\n\n    Examples: \n      | username        | password      |\n      | teamchallengers | ds@qateam334h |\n\n  @Signin_page(validUsernameinvalidPassword)\n  Scenario Outline: DS Algo Introduction Page\n    When The user clicks login button after entering valid \"<username>\" and invalid \"<password>\"\n    Then The user should able to see an error message \"Invalid Username and Password\".\n\n    Examples: \n      | username            | password |\n      | Trioteamchallengers |          |\n\n  @Signin_page(validUsernameInvPwd)\n  Scenario Outline: DS Algo Introduction Page\n    When The user clicks login button after entering valid \"<username>\" and invalid \"<password>\"\n    Then The error message \"Please fill out this field.\" appears below Username textbox\n\n    Examples: \n      | username            | password      |\n      | Trioteamchallengers | ds@qateam334h |\n\n  @Signin_page(valid)\n  Scenario Outline: DS Algo Introduction Page\n    When The user clicks login button after entering valid \"<username>\" and valid \"<password>\"\n    Then The user should land in Data Structure Home Page with \"You are logged in\" message\n\n    Examples: \n      | username            | password        |\n      | Trioteamchallengers | triothebest@123 |\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/enggn/eclipse-workspace/DSAlgo_Cucumber/src/test/resources/Features/03_dsSignin.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"to automate Signin page of DS_Algo","description":"","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","name":"background","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"The user is on the DS Algo Introduction Page","id":"56e4e939-00d8-4941-9df3-309a552e7cdd"}],"id":"948d8fc9-0276-4a50-9455-76fcfb50c69f"}},{"scenario":{"location":{"line":7,"column":3},"tags":[{"location":{"line":6,"column":3},"name":"@Signin_page(link)","id":"78494713-0a35-4358-8f22-08973e3e86d8"}],"keyword":"S t \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When The User clicks a run button\n    Then The user see error msg in alert window and press ok button\n\n    Examples: \n      | sheetname   | colname             | rownum |\n      | Python_code | Python_Invalid_Data |      2 |\n\n  @PythonEditor_Valid\n  Scenario Outline: Python Editor page with valid data\n    Given The user is on the tryEditor page\n    And enters data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When User clicks a run button\n    Then output should be displayed on the console\n\n    Examples: \n      | sheetname   | colname           | rownum |\n      | Python_code | Python_Valid_Data |      2 |\n\n  Scenario: User go back to the previous page\n    Given The user is already on tryEditor page\n    When User able to see output in console\n    Then User go back to the previous page\n\n  @PracticeQuestions\n  Scenario: Time Complexity Page\n    Given The user is on the Time Complexity Page\n    When The user clicks Practice Questions link of DS\n    Then The user does not find any practice problems and the page is null\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/enggn/eclipse-workspace/DSAlgo_Cucumber/src/test/resources/Features/04_dsDataStructInt.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"To Automate the page of Data Structure","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[{"location":{"line":3,"column":3},"name":"@HomePage","id":"fcac67b3-e182-459f-aed7-58f2f23996e1"}],"keyword":"Scenario","name":"Home Page","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"The user is on the DS Algo Home Page","id":"32f3f856-ec35-4869-a6da-7ef6bf53eee9"},{"location":{"line":6,"column":5},"keyword":" uld be redirected to \"Arrays in Python\" AP Page\n\n  @PythonEditor\n  Scenario: Array Page\n    Given The  user is on the Array  page\n    When The user clicks Try Here button of Array in Python Page\n    Then The user should be redirected to a page having an Python Editor with a url \"https://dsportalapp.herokuapp.com/tryEditor\"\n\n  @PythonEditor_Blank\n  Scenario: Python Editor page without data\n    Given The user is on tryEditor page\n    When The user clicks the run button without entring the code in the Editor\n    Then Nothing happens to the page and no error message is displayed\n\n  @PythonEditor_Invalid\n  Scenario Outline: Python Editor page with Invalid data\n    Given User is on the tryEditor page\n    And enters the data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When The User clicks a run button\n    Then The user see error msg in alert window and press ok button\n\n    Examples: \n      | sheetname   | colname             | rownum |\n      | Python_code | Python_Invalid_Data |      2 |\n\n  @PythonEditor_Valid\n  Scenario Outline: Python Editor page with valid data\n    Given The user is on the tryEditor page\n    And enters data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When User clicks a run button\n    Then output should be displayed on the console\n\n    Examples: \n      | sheetname   | colname           | rownum |\n      | Python_code | Python_Valid_Data |      2 |\n\n  Scenario: User go back to the previous page\n    Given The user is already on tryEditor page\n    When User able to see output in console\n    Then User go back to the previous page\n\n  @ArraysUsingList_page\n  Scenario: Array in Python Page\n    Given The user is on the Array in Python Page\n    When The user clicks a Arrays Using List link\n    Then The user should be redirected to \"Arrays Using List\" AL p should be redirected to \"https://dsportalapp.herokuapp.com/tryEditor\" tryEditor page having Editor and run button\n\n  @PythonEditor_Blank\n  Scenario: Python Editor page without data\n    Given The user is on tryEditor page\n    When The user clicks the run button without entring the code in the Editor\n    Then Nothing happens to the page and no error message is displayed\n\n\t@PythonEditor_Invalid\n  Scenario Outline: Python Editor page with Invalid data\n    Given User is on the tryEditor page\n    And enters the data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When The User clicks a run button\n    Then The user see error msg in alert window and press ok button\n\n    Examples: \n      | sheetname   | colname           | rownum |\n      | Python_code | Python_Invalid_Data |      2 |\n\n  @PythonEditor_Valid\n  Scenario Outline: Python Editor page with valid data\n    Given The user is on the tryEditor page\n    And enters data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When User clicks a run button\n    Then output should be displayed on the console\n\n    Examples: \n      | sheetname   | colname         | rownum |\n    | Python_code | Python_Valid_Data |      2 |\n\n \t@previousPage\n  Scenario: User go back to the previous page\n    Given The user is already on tryEditor page\n    When User able to see output in console\n    Then User go back to the previous page\n\n  #--------------------------------------------- Link 2: Creating Linked LIst -------------------------------------------------------------------------\n  @CreatingLinkedList\n  Scenario: Creating Linked LIst link of Linked List module\n    Given User is on Introduction page\n    When User clicks Creating Linked LIst link\n    Then User should be redirected to \"Creating Linked LIst\" Creating Linked LIst of Linked List page\n\n\t@P  menu\n    Then The user should be directed to \"Stack\" Stack Page\n\n  @sp_operations\n  Scenario: User Perform Operations on Stack page\n    Given The user is in the  after logged in\n    When The user clicks Operations in Stack button\n    Then The user should be directed to the \"Operations in Stack\" Operations in Stack Page\n\n\t @Operationseditor\n  Scenario: check user directed to tryeditor\n    Given The user is in the Operations in Stack page\n    When The user clicks Try Here button\n    Then The user should be redirected to a page having an tryEditor with a \"Run\" button to test\n\t\n\t @PythonEditor_Blank\n  Scenario: Python Editor page without data\n    Given The user is on tryEditor page\n    When The user clicks the run button without entring the code in the Editor\n    Then Nothing happens to the page and no error message is displayed\n\n  @PythonEditor_Invalid\n  Scenario Outline: Python Editor page with Invalid data\n    Given User is on the tryEditor page\n    And enters the data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When The User clicks a run button\n    Then The user see error msg in alert window and press ok button\n\n    Examples: \n      | sheetname   | colname           | rownum |\n      | Python_code | Python_Invalid_Data |      2 |\n\n  @PythonEditor_Valid\n  Scenario Outline: Python Editor page with valid data\n    Given The user is on the tryEditor page\n    And enters data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When User clicks a run button\n    Then output should be displayed on the console\n\n    Examples: \n      | sheetname   | colname         | rownum |\n      | Python_code | Python_Valid_Data |      2 |\n\n  @previousPage\n  Scenario: User go back to the previous page\n    Given The user is already on tryEditor page\n    When User able to see output in console\n    Then User go back to the previous page\n\t\n\n  @sp_implementation\n  Scenario: To test the Implementation on stack page\n    Given The user is in the Stack page after logged in\n    When The user clicks Implementation button\n    Then The user should be directed to \"Implementation\" Implementation Page2\n    \n     @Operationseditor\n  Scenario: check user directed to tryeditor\n    Given The user is in the Operations in Stack page\n    When The user clicks Try Here button\n    Then The user should be redirected to a page having an tryEditor with a \"Run\" button to test\n    \n     @PythonEditor_Blank\n  Scenario: Python Editor page without data\n    Given The user is on tryEditor page\n    When The user clicks the run button without entring the code in the Editor\n    Then Nothing happens to the page and no error message is displayed\n\n  @PythonEditor_Invalid\n  Scenario Outline: Python Editor page with Invalid data\n    Given User is on the tryEditor page\n    And enters the data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When The User clicks a run button\n    Then The user see error msg in alert window and press ok button\n\n    Examples: \n      | sheetname   | colname           | rownum |\n     | Python_code | Python_Invalid_Data |      2 |\n\n  @PythonEditor_Valid\n  Scenario Outline: Python Editor page with valid data\n    Given The user is on the tryEditor page\n    And enters data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When User clicks a run button\n    Then output should be displayed on the console\n\n    Examples: \n      | sheetname   | colname         | rownum |\n      | Python_code | Python_Valid_Data |      2 |\n\n  @previousPage\n  Scenario: User go back to the previous page\n    Given The user is already on tryEditor page\n    When User able to see output in console\n    Then User go back to the previous page\n    \n\n  @sp_application\n  Scenario: To test application on stack page\n    Given The user is in the Stack page1 after logged in\n    When The user clicks Application button\n    Then The user should be directed to \"Applications\" Applications Page3\n\n @Operationseditor\n  Scenario: check user directed to tryeditor\n    Given The user is in the Operations in Stack page\n    When The user clicks Try Here button\n    Then The user should be redirected to a page having an tryEditor with a \"Run\" button to test\n    \n     @PythonEditor_Blank\n  Scenario: Python Editor page without data\n    Given The user is on tryEditor page\n    When The user clicks the run button without entring the code in the Editor\n    Then Nothing happens to the page and no error message is displayed\n\n  @PythonEditor_Invalid\n  Scenario Outline: Python Editor page with Invalid data\n    Given User is on the tryEditor page\n    And enters the data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When The User clicks a run button\n    Then The user see error msg in alert window and press ok button\n\n    Examples: \n      | sheetname   | colname           | rownum |\n      | Python_code | Python_Invalid_Data |      2 |\n\n  @PythonEditor_Valid\n  Scenario Outline: Python Editor page with valid data\n    Given The user is on the tryEditor page\n    And enters data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When User clicks a run button\n    Then output should be displayed on the console\n\n    Examples: \n      | sheetname   | colname         | rownum |\n      | Python_code | Python_Valid_Data |      2 |\n\n  @previousPage\n  Scenario: User go back to the previous page\n    Given The user is already on tryEditor page\n    When User able to see output in console\n    Then User go back to the previous page\n    \n\n\n  @sp_practiceQ\n  Scenario: To test practice questions on stack page\n    Given The user is in the Stack page2 after logged in\n    When The user clicks Practice Questions button in Stack\n    Then The user should be redirected to \"Practice Questions\" P Questions page\n\n  @backtoDSHomePage\n  Scenario: User go back to the DS Algo home page\n    Given The user is already on Practice Questions page\n    When Nothing is displayed on the page\n    Then User go back to the \"https://dsportalapp.herokuapp.com/home\" DS Algo home page\n ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/enggn/eclipse-workspace/DSAlgo_Cucumber/src/test/resources/Features/07_stack.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"To Automate  the Stack page of DS_Algo","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[{"location":{"line":3,"column":3},"name":"@stack_homepage","id":"de15bfea-3f05-46f0-b4e1-738673c758e2"}],"keyword":"Scenario","name":"DS Algo home page","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"The user is in the DS Home page after logged in","id":"52fe80d6-1948-4f30-857c-daac343d33d5"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"The user clicks the Get Started in Stack Panel or select Stack item from the drop down menu","id":"e07252eb-d707-4f13-b535-a8411e3c9a22"},{"location":{"line":7,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"The user should be directed to \"Stack\" Stack Page","id":"f8cc58d9-d557-4311-9c6e-16746c1dc52d"}],"examples":[],"id":"25e7cf6d-6fea-4fdd-844a-698cb2f098b4"}},{"scenario":{"location":{"line":10,"column":3},"tags":[{"location":{"line":9,"column":3},"name":"@sp_operations","id":"961976fb-c7be-4ad5-897b-6b46aefb0095"}],"keyword":"Scenario","name":"User Perform Operations on se}},{"source":{"uri":"file:///C:/Users/enggn/eclipse-workspace/DSAlgo_Cucumber/src/test/resources/Features/08_queue.feature","data":"Feature: To test the Queue page\n\n  Scenario: Enter into Queue page\n    Given The user is on the DS Home page after logged in\n    When The user clicks the GetStarted in Queue Panel or select QueueDS item from the drop down menu\n    Then The user should be directed to \"Queue\" queue Page\n\n  #---------------------------------- link 1: Implementation of Queue in Python---------------------------------------------------------\n  @qp_Imple_Q_py\n  Scenario: User Perform Implementation in python on queue page\n    Given The user is in the Queue page after logged in\n    When The user clicks Implementation of Queue in Python button\n    Then The user should be directed to \"Implementation of Queue in Python\" Pageq1\n\n  @Operationseditor\n  Scenario: check user is directed to tryeditor\n    Given The user is in the Implementation of Queue in Python in Queue page\n    When The user clicks Try Here button\n    Then The user should be redirected to a page having an tryEditor with a \"Run\" button to test\n\n  @PythonEditor_Blank\n  Scenario: Python Editor page without data\n    Given The user is on tryEditor page\n    When The user clicks the run button without entring the code in the Editor\n    Then Nothing happens to the page and no error message is displayed\n\n  @PythonEditor_Invalid\n  Scenario Outline: Python Editor page with Invalid data\n    Given User is on the tryEditor page\n    And enters the data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When The User clicks a run button\n    Then The user see error msg in alert window and press ok button\n\n    Examples: \n      | sheetname   | colname           | rownum |\n      | Python_code | Python_Invalid_Data |      2 |\n\n  @PythonEditor_Valid\n  Scenario Outline: Python Editor page with valid data\n    Given The user is on the tryEditor page\n    And enters data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When User clicks a run button\n    Then output should be displayed on the console\n\n    Examples: \n      | sheetname   | colname         | rownum |\n      | Python_code | Python_Valid_Data |      2 |\n\n  @previousPage\n  Scenario: User go back to the previous page\n    Given The user is already on tryEditor page\n    When User able to see output in console\n    Then User go back to the previous page\n\n  #--------------------------------------------- Link 2: Implementation using collections.deque---------------------------------------------------\n  @qp_implementation.deq\n  Scenario: To test the Implementation.dq on queue page\n    Given The user is in the Implementation of Queue in Python in Queue page\n    When The user clicks Implementation using Collections.deque button\n    Then The user should be directed to \"Implementation using collections.deque\" collections deque Pageq2\n\n  @Operationseditor\n  Scenario: check user directed to tryeditor\n    Given The user is in the Operations in Stack page\n    When The user clicks Try Here button\n    Then The user should be redirected to a page having an tryEditor with a \"Run\" button to test\n\n  @PythonEditor_Blank\n  Scenario: Python Editor page without data\n    Given The user is on tryEditor page\n    When The user clicks the run button without entring the code in the Editor\n    Then Nothing happens to the page and no error message is displayed\n\n  @PythonEditor_Invalid\n  Scenario Outline: Python Editor page with Invalid data\n    Given User is on the tryEditor page\n    And enters the data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When The User clicks a run button\n    Then The user see error msg in alert window and press ok button\n\n    Examples: \n      | sheetname   | colname           | rownum |\n     | Python_code | Python_Invalid_Data |      2 |\n\n  @PythonEditor_Valid\n  Scenario Outline: Python Editor page with valid data\n    Given The user is on the tryEditor page\n    And enters data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When User clicks a run button\n    Then output should be displayed on the console\n\n    Examples: \n      | sheetname   | colname         | rownum |\n      | Python_code | Python_Valid_Data |      2 |\n\n  @previousPage\n  Scenario: User go back to the previous page\n    Given The user is already on tryEditor page\n    When User able to see output in console\n    Then User go back to the previous page\n\n  #----------------------------------------- Link 3: Implementation using Array -------------------------------------------------------------\n  @qp_Imp_array\n  Scenario: To test the Implementation using array\n    Given The user is in the Queue page after logged in\n    When The user clicks Implementation using Array button\n    Then The user should be directed to \"Implementation using array\" Implementation using Array Pageq3\n\n  @Operationseditor\n  Scenario: check user directed to tryeditor\n    Given The user is in the Operations in Stack page\n    When The user clicks Try Here button\n    Then The user should be redirected to a page having an tryEditor with a \"Run\" button to test\n\n  @PythonEditor_Blank\n  Scenario: Python Editor page without data\n    Given The user is on tryEditor page\n    When The user clicks the run button without entring the code in the Editor\n    Then Nothing happens to the page and no error message is displayed\n\n  @PythonEditor_Invalid\n  Scenario Outline: Python Editor page with Invalid data\n    Given User is on the tryEditor page\n    And enters the data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When The User clicks a run button\n    Then The user see error msg in alert window and press ok button\n\n    Examples: \n      | sheetname   | colname           | rownum |\n      | Python_code | Python_Invalid_Data |      2 |\n\n  @PythonEditor_Valid\n  Scenario Outline: Python Editor page with valid data\n    Given The user is on the tryEditor page\n    And enters data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When User clicks a run button\n    Then output should be displayed on the console\n\n    Examples: \n      | sheetname   | colname         | rownum |\n      | Python_code | Python_Valid_Data |      2 |\n\n  @previousPage\n  Scenario: User go back to the previous page\n    Given The user is already on tryEditor page\n    When User able to see output in console\n    Then User go back to the previous page\n\n  #--------------------------------------------- Link 4: Queue Operations ---------------------------------------------------------------------\n  @qp_Qoperations\n  Scenario: To perform Queue Operations\n    Given The user is in  Implementation using Array Page\n    When The user clicks Queue Operations button\n    Then The user should be directed to \"Queue Operations\" Queue Operations Pageq33\n\n  @Operationseditor\n  Scenario: check user directed to tryeditor\n    Given The user is in the Operations in Stack page\n    When The user clicks Try Here button\n    Then The user should be redirected to a page having an tryEditor with a \"Run\" button to test\n\n  @PythonEditor_Blank\n  Scenario: Python Editor page without data\n    Given The user is on tryEditor page\n    When The user clicks the run button without entring the code in the Editor\n    Then Nothing happens to the page and no error message is displayed\n\n  @PythonEditor_Invalid\n  Scenario Outline: Python Editor page with Invalid data\n    Given User is on the tryEditor page\n    And enters the data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When The User clicks a run button\n    Then The user see error msg in alert window and press ok button\n\n    Examples: \n      | sheetname   | colname           | rownum |\n      | Python_code | Python_Invalid_Data |      2 |\n\n  @PythonEditor_Valid\n  Scenario Outline: Python Editor page with valid data\n    Given The user is on the tryEditor page\n    And enters data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When User clicks a run button\n    Then output should be displayed on the console\n\n    Examples: \n      | sheetname   | colname         | rownum |\n     | Python_code | Python_Valid_Data |      2 |\n\n  @previousPage\n  Scenario: User go back to the previous page\n    Given The user is already on tryEditor page\n    When User able to see output in console\n    Then User go back to the previous page\n\n  #------------------------------------- practice Question -----------------------------------------------------------------------\n  @qp_pracQues\n  Scenario: to test practice question link\n    Given The user is in the Queue page\n    When The user clicks Practice Questions on queue\n    Then The user should be redirected to \"Practice Questions\" Practice Questions page of queue\n\n  @backtoDSHomePage\n  Scenario: User go back to the DS Algo home page\n    Given The user is already on Practice Questions page\n    When Nothing is displayed on the page\n    Then User go back to the \"https://dsportalapp.herokuapp.com/home\" DS Algo home page\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/enggn/eclipse-workspace/DSAlgo_Cucumber/src/test/resources/Features/08_queue.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"To te 442a-9ceb-46af8c0619ac","timestamp":{"seconds":1701918036,"nanos":250881300},"willBeRetried":false}},{"source":{"uri":"file:///C:/Users/enggn/eclipse-workspace/DSAlgo_Cucumber/src/test/resources/Features/10_dsGraph.feature","data":"Feature: Automatating Graph Module pages\n\n@Graphpage\n  Scenario: Get started to graph from DS Algo home page\n    Given User is on DS algo home page \n    When User clicks Get started button\n    Then User should be redirected to \"https://dsportalapp.herokuapp.com/graph/\" graph home page\n\n@Graphpage\n  Scenario: Graph home page\n    Given User is on Graph home page\n    When User clicks Graph link\n    Then User should be redirected to \"Graph\" graph page\n \n @PythonEditor\n  Scenario: Graph page\n    Given User is on Graph page\n    When User clicks Try Here link\n    Then User should be redirected to \"https://dsportalapp.herokuapp.com/tryEditor\" tryEditor page having Editor and run button\n\n@PythonEditor_Blank\n  Scenario: Python Editor page without data\n    Given The user is on tryEditor page\n    When The user clicks the run button without entring the code in the Editor\n    Then Nothing happens to the page and no error message is displayed\n\n@PythonEditor_Invalid\n  Scenario Outline: Python Editor page with Invalid data\n    Given User is on the tryEditor page\n    And enters the data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When The User clicks a run button\n    Then The user see error msg in alert window and press ok button\n\n    Examples: \n      | sheetname   | colname           | rownum |\n      | Python_code | Python_Invalid_Data |      2 |\n\n@PythonEditor_Valid\n  Scenario Outline: Python Editor page with valid data\n    Given The user is on the tryEditor page\n    And enters data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When User clicks a run button\n    Then output should be displayed on the console\n\n    Examples: \n      | sheetname   | colname         | rownum |\n      | Python_code | Python_Valid_Data |      2 |\n\n@previousPage\n  Scenario: User go back to Graph page\n    Given The user is already on tryEditor page\n    When User able to see output in console\n    Then User go back to the previous page\n\n@GraphRepresentations\n  Scenario: Graph page second link\n    Given User is on Graph page\n    When User clicks Graph Representations link\n    Then User should be redirected to \"Graph Representations\" Graph Representations page\n\n@PythonEditor\n  Scenario: Graph Representations page\n    Given User is on Graph Representations page\n    When User clicks Try Here link\n    Then User should be redirected to \"https://dsportalapp.herokuapp.com/tryEditor\" tryEditor page having Editor and run button\n\n@PythonEditor_Blank\n  Scenario: Python Editor page without data\n    Given The user is on tryEditor page\n    When The user clicks the run button without entring the code in the Editor\n    Then Nothing happens to the page and no error message is displayed\n\n@PythonEditor_Invalid\n  Scenario Outline: Python Editor page with Invalid data\n    Given User is on the tryEditor page\n    And enters the data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When The User clicks a run button\n    Then The user see error msg in alert window and press ok button\n\n    Examples: \n      | sheetname   | colname           | rownum |\n      | Python_code | Python_Invalid_Data |      2 |\n\n @PythonEditor_Valid\n  Scenario Outline: Python Editor page with valid data\n    Given The user is on the tryEditor page\n    And enters data in the Editor after reading data from excel sheet \"<sheetname>\" with column_name \"<colname>\" and row_number <rownum>\n    When User clicks a run button\n    Then output should be displayed on the console\n\n    Examples: \n      | sheetname   | colname         | rownum |\n      | Python_code | Python_Valid_Data |      2 |\n\n @previousPage\n  Scenario: User go back to Graph page\n    Given The user is already on tryEditor page\n    When User able to see output in console\n    Then User go back to the previous page\n\n@GraphPracticeQuestions\n  Scenario: Graph page Practice Questions\n    Given User is on Graph page\n    When User clicks Practice Questions link\n    Then User should be redirected to \" Practice Questions \" Practice Questions page\n\n@backtoDSHomePage\n  Scenario: User go back to the DS Algo home page\n    Given The user is already on Practice Questions page of Graph\n    When Nothing is displayed on the page of Practice Questions\n    Then User go back to the \"https://dsportalapp.herokuapp.com/home\" DS home page\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/enggn/eclipse-workspace/DSAlgo_Cucumber/src/test/resources/Features/10_dsGraph.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Automatating Graph Module pages","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[{"location":{"line":3,"column":1},"name":"@Graphpage","id":"e34ca2b0-1a1b-4f58-9e02-54a024c54c88"}],"keyword":"Scenario","name":"Get started to graph from DS Algo home page","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"User is on DS algo home page","id":"73222e0b-afb1-44f2-94b7-35c8fa8ef0a4"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"User clicks Get started button","id":"173d3f0f-9019-45a1-afac-f00e468fb458"},{"location":{"line":7,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"User should be redirected to \"https://dsportalapp.herokuapp.com/graph/\" graph home page","id":"d014623d-75c4-4e1d-9203-72fdc6c63dc2"}],"examples":[],"id":"3e
